import React from 'react';
import './card-style.css'


class Card extends React.Component {
  render() {
    return (
    	<article class="flashcard">
		  <input id="flashcard-1" type="checkbox" />
		  <label for="flashcard-1">
		    <section class="front">
		      Front of the flashcard!
		    </section>
		    
		    <section class="back">
		      Back of the flashcard!
		    </section>
		  </label>
		</article>
    );
  }
}

export default Card;
